import React from 'react';
import './App.css';
import {Container, Nav} from "./components/styled-components";
function App() {
  return (
    <Container>
      <Nav className = "navbar navbar-expand-lg fixed-top">
        <Container className = "navbar-brand mb-0">
          Coronavirus Dashboard
        </Container>
        <Container className="navbar-nav ml-auto">
          <Container className="author-section">
            Cretaed and Maintained by Hari Shankar
          </Container>
        </Container>
      </Nav>
      <Nav className="navbar navbar-expand-lg nav-primary fixed-top is-dark is-light-text">
          <Container className="navbar-brand h1 mb-0 text-large font-medium">
            Coronavirus Dashboard
          </Container>
          <Container className="navbar-nav ml-auto">
            <Container className="user-detail-section">
              <span className="pr-2">Created and Maintained by Hari Shankar</span>
            </Container>
          </Container>
          </Nav>
    </Container>
  );
}

export default App;
